    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT + col2 * - col2 - col0 BETWEEN col2 AND ( col2 * ( + col0 ) );
  - name: tab1

outputs:
  - name: q534.out
    data: |
      51	14	96
      85	5	59
      91	47	68
